    <section class="blog_page">
        <div class="container">
            <div class="row">
                <div class="col-sm-12">
                    <div class="main_title">
                        Какой должна быть толщина металла входной двери?                    </div>
                </div>

                <div class="col-md-12">
                    <p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Если вы решили купить входную дверь из металла, то вполне очевидно, что безопасность конструкции для вас является одним из приоритетов. Модели, изготовленные из стального листа, хорошо противостоят и силовым воздействиям, и попыткам взлома замков.</span></span></span></p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">&nbsp;</p>

<p><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-ad997047-6fa9-d4fa-4841-cad74d7fea50"><span style="font-size: 26pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><img height="481" src="https://lh4.googleusercontent.com/2CcdAPX2DkFROKefEqs6kSq1gFOAAyKTh7-NA84FQn7Ta6-D3Hv4ijgl5mUHO6dgXZNMl_N2machDR_5AC_gfloe6Zcs17EOtq0xBiXjV2gKz3EYm3YoJJKJcyGPgLQUgNM7CuA" style="border: none; transform: rotate(0.00rad); -webkit-transform: rotate(0.00rad);" width="602" data-pagespeed-url-hash="4263886396" onload="pagespeed.CriticalImages.checkImageForCriticality(this);"></span></span></span></p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Одним из параметров, напрямую влияющих на уровень надежности конструкции – толщина металла, из которого производится дверное полотно. От нее зависит, насколько эффективной будет защита от несанкционированного проникновения.</span></span></span></p>

<h2 dir="ltr" style="line-height:1.38;margin-top:18pt;margin-bottom:6pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 16pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">На что влияет толщина металла?</span></span></span></h2>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Для производства металлических дверей обычно используется стальной лист. Его толщина оказывает непосредственное влияние на эксплуатационные качества изделия:</span></span></span></p>

<p><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Ключевое преимущество толстого металла – более надежная фиксация замков, петель и других элементов конструкции. Чем толще будет основание, тем надежнее будут зафиксированы эти элементы, и тем сложнее будет злоумышленнику повредить их при взломе.</span></span></span></p>

<p><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Полотно, изготовленное из толстого металла, менее подвержено деформациям. Тонколистовая сталь может деформироваться даже под небольшой нагрузкой, что приведет к изменению геометрии конструкции.</span></span></span></p>

<p><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Кроме того, на тонком металлическом листе вмятина может появиться даже от не самого сильного удара, и она сильно ухудшит внешний вид изделия.</span></span></span></p>

<h2 dir="ltr" style="line-height:1.38;margin-top:18pt;margin-bottom:6pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 16pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Достоинства и недостатки различных вариантов</span></span></span></h2>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">В качестве минимального значения для указанного параметра ГОСТом установлено 1,5 мм, а вот максимальная толщина не регламентируется. У разных производителей можно найти двери входные из металла различной толщины (от 1,2 до 4–5 мм). Так какой же вариант выбрать?</span></span></span></p>

<p>&nbsp;</p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Менее 1,5 мм</span></span></span></p>

<p>&nbsp;</p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Основные преимущества моделей, которые производятся из стального листа толщиной от 1,2 мм – малая себестоимость и небольшая масса. Их можно монтировать в проемы, изготовленные из непрочных материалов. Минусов у таких разновидностей значительно больше:</span></span></span></p>

<p>&nbsp;</p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Они деформируются даже под собственным весом, со временем перекашиваясь в проеме. Надежно зафиксировать замок или петли на полотне не получится. Само полотно достаточно легко отгибается, а вскрыть его можно буквально консервным ножом или отверткой.</span></span></span></p>

<p>&nbsp;</p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">В целом экономия на покупке конструкции из тонколистового металла часто приводит к финансовым потерям в результате квартирных краж.</span></span></span></p>

<p>&nbsp;</p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">От 1,5 до 2 мм</span></span></span></p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">&nbsp;</p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Металл толщиной 1,5 мм прочнее и менее склонен к деформациям. При этом он относительно легко гнется, что позволяет производить конструкции с повышенными механическими характеристиками.</span></span></span></p>

<p>&nbsp;</p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Если же базовый уровень безопасности кажется вам недостаточным, то вы можете купить металлическую дверь из металлического листа толщиной 2 мм. Она тяжелее, но зато отличается более высокими показателями взломостойкости.</span></span></span></p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">&nbsp;</p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Более 2 мм</span></span></span></p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">&nbsp;</p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Иногда конструкции делают из более толстого материала — от 2,5 до 4–5 мм. Использование толстого металла повышает механическую стойкость конструкции: взломать такую дверь (при нужном уровне надёжности замка и петель будет очень сложно).</span></span></span></p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">К сожалению, есть у такого решения минусы:</span></span></span></p>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">&nbsp;</p>

<ul dir="ltr">
	<li style="list-style-type: disc; font-size: 10.5pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Применение металла толщиной более 2,5 мм повышает себестоимость.</span></span></span></li>
	<li style="list-style-type: disc; font-size: 10.5pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span style="font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Изделие получается тяжелым, что усложняет и его доставку, и подъем на этаж, и установку (есть риск разрушения проема)</span></span><span style="font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"> </span></span></span></span></span></li>
	<li style="list-style-type: disc; font-size: 10.5pt; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre; line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span style="font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;"><span style="font-size: 11pt; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Полотно, изготовленное из толстой стали, оказывает повышенную нагрузку на петли, что приводит к его провисанию. При этом петли чаще требуют регулировки.</span></span></span></li>
</ul>

<p><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Потому и не получают распространения утолщенные металлические двери: цена и доставка также сложности с установкой и эксплуатацией делают их менее популярными, чем более универсальные варианты.</span></span></span></p>

<h2 dir="ltr" style="line-height:1.38;margin-top:18pt;margin-bottom:6pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 16pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Вывод </span></span></span></h2>

<p dir="ltr" style="line-height:1.38;margin-top:0pt;margin-bottom:0pt;"><span style="font-family:arial,helvetica,sans-serif;"><span id="docs-internal-guid-3df7af48-6fa7-69ce-0aef-3f954b214358"><span style="font-size: 11pt; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;">Покупая металлические двери для частного дома или квартиры, стоит отдавать предпочтение моделям, изготовленным из стали толщиной от 1,5 до 2 мм. Более толстый металл обеспечивает взломостойкость, но удорожает конструкцию, усложняя при этом и монтаж, и эксплуатацию. Ну, а сталь толщиной менее 1,5 мм не обеспечивает нужной безопасности, потому от покупки такой модели стоит отказаться</span></span></span></p>
                </div>
            </div>
        </div>
